      ("query2", 1614556808),
      ("query3", 1614556809),
      ("query4", 1614556810),
      ("query5", 1614556811)
    )).toJavaRDD

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.parallelize(Seq(
      "query1",
      "query2",
      "query3"
    )).toJavaRDD

    // Broadcast top frequent queries
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, (Long, Boolean)] = Map()

    // Process onsite attributed data
    val hitRate = onsiteData.mapPartitions(iter => {
      val cachePart = cache.synchronized {
        iter.map { case (query, timestamp) =>
          if (broadcastTopQueries.value.contains(query)) {
            val cacheEntry = cache.get(query)
            if (cacheEntry.isEmpty || timestamp - cacheEntry.get._1 > 12 * 60 * 60) {
