Creating a Chrome extension involves several steps and requires knowledge of HTML, CSS, and JavaScript. Here's a basic outline of how you can create a Chrome extension that takes screenshots of a webpage:

1. Create a new folder for your extension and create the following files inside it:

- `manifest.json`: This file contains metadata about your extension, such as its name, description, version, and permissions.

- `popup.html`: This file contains the HTML code for the extension's popup window.

- `popup.js`: This file contains the JavaScript code for the extension's popup window.

2. Add the following code to `manifest.json`:
```json
{
  "manifest_version": 2,
  "name": "Screenshot Extension",
  "description": "This extension takes screenshots of webpages",
  "version": "1.0",
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "permissions": [
    "activeTab",
    "tabs",
    "<all_urls>"
  ]
}
```
3. Add the following code to `popup.html`:
```html
<!DOCTYPE html>
<html>
  <head>
    <style>
      body {
        width: 200px;
        height: 200px;
      }
      button {
        width: 100%;
        height: 100%;
      }
    </style>
  </head>
  <body>
    <button id="screenshot-button">Take Screenshot</button>
    <script src="popup.js"></script>
  </body>
</html>
```
4. Add the following code to `popup.js`:
```javascript
document.getElementById('screenshot-button').addEventListener('click', function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.captureVisibleTab(null, {}, function(image) {
      var screenshotUrl = image;
      var viewTabUrl = tabs[0].url;
      chrome.tabs.create({url: screenshotUrl, active: true});
    });
  });
});
```
5. Load your extension into Chrome:

- Open Chrome and navigate to `chrome://extensions/`.
- Enable "Developer mode" by clicking the toggle switch in the top right corner.
- Click the "Load unpacked" button and select the folder containing your extension.

Your extension should now be loaded and you should see its icon in the Chrome toolbar. When you click the icon, a popup window will appear with a "Take Screenshot" button. When you click the button, the extension will take a screenshot of the current webpage and open it in a new tab.

