Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
A static variable is a variable that has been allocated statically, i.e., at compile time. It retains its value between function calls and is initialized only once. Static variables are declared using the keyword "static".

Here are some important points about static variables:

* Static variables are initialized only once and retain their value between function calls.
* Static variables are stored in the data segment of the program's memory.
* Static variables have a default value of zero if not explicitly initialized.
* Static variables can be declared inside a function or outside a function. If declared inside a function, they are only accessible within that function. If declared outside a function, they are accessible to all functions in the same file.

Example:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
Output:
```
Count: 1
Count: 2
Count: 3
```
In this example, the static variable "count" is initialized to 0 and incremented each time the function "increment" is called. The value of "count" is retained between function calls.

